'use strict';

var WRRPool = require('./lib/index');
var _ = require('lodash');

var pool = new WRRPool();

var i = 5000;

while (i--) {
    pool.add('A' + i, Math.floor(50 * Math.random()));
}

var start = Date.now();

i = 5000000;

while (i--) {
    pool.next();
}

console.log(Date.now() - start);
